#!/bin/sh

# data:[<mime type>][;charset=<charset>][;base64],<encoded data>




cats_array=(
    "data:image/jpeg;base64,"
    "data:image/jpeg;base64,"
    "data:image/jpeg;base64,"
    "data:image/jpeg;base64,"
    "data:image/jpeg;base64,"
    "data:image/jpeg;base64,"
    "data:image/jpeg;base64,"
    "data:image/png;base64,"
    "data:image/png;base64,"
    "data:image/jpeg;base64,"
    "data:image/jpeg;base64,"
    "data:image/jpeg;base64,"
    "data:image/jpeg;base64,"
    "data:image/jpeg;base64,"
    "data:image/jpeg;base64,"
    "data:image/jpeg;base64,"
    "data:image/jpeg;base64,"
)

# http://cats-pet-battle-api.apps.s43.core.rht-labs.com
export HOST=cats-pet-battle-api.apps.s43.core.rht-labs.com
export CONTENT_TYPE="content-type: application/json"

echo "Clearing the DB of all cats "
curl -s -H "Content-Type: application/json" -X DELETE http://${HOST}/cats/kittykiller

echo "Check any cats were missed .... "
curl -s -H "Content-Type: application/json" -X GET http://${HOST}/cats/ | jq

for img in "${cats_array[@]}"; do
    counter=$[ ( $RANDOM % 5 )  + 0 ] 
    json_req='{"count":"'$counter'","vote":true,"image":"'$img'"}'
    # curl -s -X POST -H "$CONTENT_TYPE" --data "${json_req}" http://$HOST/cats/
    curl -s -X POST -H "$CONTENT_TYPE" http://$HOST/cats/ -d @/dev/fd/3 3<< EOF
${json_req}
EOF
    echo "...."

done
